import { defineStore } from 'pinia'
import axios from "axios"

export const useFornecedorStore = defineStore("fornecedor", {
    state: () => {
      return { count: 0 };
    },

    actions: {
      increment(value = 1) {
        this.count += value;
      },
    },

    getters: {
      doubleCount: (state) => {
        return state.count * 2;
      },
      doublePlusOne() {
        return this.doubleCount + 1
      },
    },
  });
